import React from "react";
import styled from "styled-components";

const GeneralDiv = styled.div`
  background: #f3f3f3;
  box-shadow: 0 2px 30px white;
  border-radius: 10px;
  box-sizing: border-box;
  margin-right: 30rem;
  margin-left: 30rem;
  padding: 0rem 0.75rem;
`;

const Card = (props) => {
  return <GeneralDiv>{props.children}</GeneralDiv>;
};

export default Card;
